// Define the IRQ exception handler
void __attribute__ ((interrupt)) __cs3_isr_irq (void)
{
    // Read the ICCIAR from the processor interface
    int address = MPCORE_GIC_CPUIF + ICCIAR;
    int int_ID = *((int *) address);

    if(int_ID == PS2_IRQ) {PS2_ISR ();}        		 //check if interrupt is from PS2
    else if(int_ID == KEYS_IRQ) {pushbutton_ISR();}  //check if interrupt is from Keys
    else if(int_ID == MPCORE_PRIV_TIMER_IRQ) {priv_timer_ISR();} //check if interrupt is from Timer
    else {while (1);}

    // Write to the End of Interrupt Register (ICCEOIR)
    address = MPCORE_GIC_CPUIF + ICCEOIR;
    *((int *) address) = int_ID;

    return;
}

// Define the remaining exception handlers
void __attribute__((interrupt)) __cs3_reset(void) {
    while (1);
}

void __attribute__((interrupt)) __cs3_isr_undef(void) {
    while (1);
}

