/*
* Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void)
{
	int stack, mode;
	stack = A9_ONCHIP_END - 7; // top of A9 onchip memory, aligned to 8 bytes
	/* change processor to IRQ mode with interrupts disabled */
	mode = INT_DISABLE | IRQ_MODE;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
	/* set banked stack
	pointer */
	asm("mov sp, %[ps]" : : [ps] "r"(stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = INT_DISABLE | SVC_MODE;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

/*
* Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts(void)
{
	int status = SVC_MODE | INT_ENABLE;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

/*
* Configure the Generic Interrupt Controller (GIC)
*/

void config_interrupt (int int_ID, int CPU_target);
void hw_write_bits(volatile int * addr, volatile int unmask, volatile int value);

void config_GIC(void)
{
	int address; // used to calculate register addresses

	/* configure the HPS timer interrupt */
	*((int *)0xFFFED8C4) = 0x01000000;
	*((int *)0xFFFED118) = 0x00000080;
	/* configure the FPGA interval timer and KEYs interrupts */
	*((int *)0xFFFED848) = 0x00000101;
	*((int *)0xFFFED108) = 0x00000300;

	config_interrupt (PS2_IRQ, CPU0);
	config_interrupt (MPCORE_PRIV_TIMER_IRQ, CPU0);

	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all
	// priorities
	address = MPCORE_GIC_CPUIF + ICCPMR;
	*((int *)address) = 0xFFFF;

	// Set CPU Interface Control Register (ICCICR). Enable signaling of
	// interrupts
	address = MPCORE_GIC_CPUIF + ICCICR;
	*((int *)address)= ENABLE;

	// Configure the Distributor Control Register (ICDDCR) to send pending
	// interrupts to CPUs
	address = MPCORE_GIC_DIST + ICDDCR;
	*((int *)address)= ENABLE;
}

void config_priv_timer() {
	volatile int * tmr_ptr = (int *)MPCORE_PRIV_TIMER; // PS/2 port address
	*(tmr_ptr) = 50000000;
	*(tmr_ptr + 2) = 0x7; //0b111
}

/* setup HPS timer */
void config_HPS_timer()
{
	volatile int * timer_ptr = (int *)MPCORE_PRIV_TIMER; // timer base address
	// *(HPS_timer_ptr + 0x2) = 0; // write to control register to stop timer
	/* set the timer period */
	int counter = 50000000; // period = 1/(200 MHz) x (50 x 10^6) = 0.25 sec
	*(timer_ptr) = counter; // write to timer load register
	/* write to control register to start timer, with interrupts */
	*(timer_ptr + 2) = 0b0111; // int mask = 0, mode = 1, enable = 1
}

/* setup the KEY interrupts in the FPGA */
void config_KEYs() {
    volatile int *KEY_ptr = (int *) KEY_BASE; // pushbutton KEY address
    *(KEY_ptr + 2) = 0x3;                    // enable interrupts for KEY[1]
}

/* setup the PS/2 interrupts */
void config_PS2() {
    volatile int * PS2_ptr = (int *)PS2_BASE; // PS/2 port address

    *(PS2_ptr) = 0xFF; /* reset */
    *(PS2_ptr + 1) = 0x1; /* write to the PS/2 Control register to enable interrupts */
}

volatile int key_dir;
void pushbutton_ISR(void) {
    volatile int *KEY_ptr = (int *) KEY_BASE;
    int press;
    press = *(KEY_ptr + 3); // read the pushbutton interrupt register
    *(KEY_ptr + 3) = press; // Clear the interrupt
    key_dir ^= 1; // Toggle key_dir value

    return;
}

int TIME_PASSED = 0;

void priv_timer_ISR() {
	volatile int * tmr_ptr = (int *)MPCORE_PRIV_TIMER;
	TIME_PASSED = no_of_obsticles;
	*(tmr_ptr + 3) = 1;
}

#define UP 0
#define DOWN 1
#define RIGHT 2
#define LEFT 3

int move_direction = -1;
int KEYB_UP = 0; int KEYB_DOWN = 0; int KEYB_LEFT = 0; int KEYB_RIGHT = 0;
char byte1 = 0; char byte2 = 0; char byte3 = 0;

void PS2_ISR(void){

	volatile int * PS2_ptr = (int *)PS2_BASE;
	int PS2_data, RVALID;

	//int RAVAIL;

	PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
    RVALID = PS2_data & 0x8000; // extract the RVALID field
    //RAVAIL = (PS2_data & 0xffff0000) >> 16; // extract the RAVAIL field


    if(RVALID){

    	byte1 = byte2;
		byte2 = byte3;
		byte3 = PS2_data & 0xFF;

		// Click Enter when to play again
		if( game_state == DEAD || game_state == VICTORY ){
			if(byte2 == (char)0xf0 && byte3 == (char)0x5a ){
				restart = TRUE;
			}
		}

		//space bar

		else if(byte2 == (char)0xf0 && byte3 == (char)0x29 ){
			player_mode = 1 - player_mode;
			refresh = TRUE;
		}

		//p - for pause

		else if(byte2 == (char)0xf0 && byte3 == (char)0x4d ){
			if( game_state == PAUSED )
				game_state = PLAYING;
			else if( game_state == PLAYING )
				game_state = PAUSED;
		}

		else if( game_state == PLAYING ){
			//up arrow

			if(byte2 == (char)0xe0 && byte3 == (char)0x75 ){
				KEYB_UP = 1;
				move_direction = UP;
			}

			//down arrow
			else if(byte2 == (char)0xe0 && byte3 == (char)0x72 ){
				KEYB_DOWN = 1;
				move_direction = DOWN;
			}

			//left arrow
			else if(byte2 == (char)0xe0 && byte3 == (char)0x6b ){
				KEYB_LEFT = 1;
				move_direction = LEFT;
			}

			//right arrow
			else if(byte2 == (char)0xe0 && byte3 == (char)0x74 ){
				KEYB_RIGHT = 1;
				move_direction = RIGHT;
			}
		}
    }

}

void HPS_timer_ISR()
{
	volatile int * HPS_timer_ptr = (int *)MPCORE_PRIV_TIMER; // HPS timer address
	// ++tick; // used by main program
	// *(led_ptr) = tick;
	*(HPS_timer_ptr + 3) = 1; // Read timer end of interrupt register to
	// clear the interrupt
	return;
}

/*
 * Configure registers in the GIC for individual interrupt IDs.
*/
void config_interrupt (int int_ID, int CPU_target)
{
    int p, value;
    int address, address_diff;
    p = (int_ID >> 2) << 2;
    address_diff = ICDIPTR + p;
    value = CPU_target << ((int_ID & 0x3) << 3);

    address = MPCORE_GIC_DIST + address_diff;
    hw_write_bits((int *) address, 0xff << ((int_ID & 0x3) << 3), value);

    p = (int_ID >> 5) << 2;
    address_diff = ICDISER + p;
    value = 0x1 << (int_ID & 0x1f);

    address = MPCORE_GIC_DIST + address_diff;
    hw_write_bits((int *) address, 0x1 << (int_ID & 0x1f), value);
}

void hw_write_bits(volatile int * addr, volatile int unmask, volatile int value)
{
    *addr = ((~unmask) & *addr) | value;
}

