int main(void) {

	//Initialize Interrups

	set_A9_IRQ_stack(); 	//initialize the stack pointer for IRQ mode
	config_GIC();       	//configure the general interrupt controller
	//config_HPS_timer();
	config_KEYs();
	config_PS2();
	config_priv_timer();
	enable_A9_interrupts(); //enable interrupts

	//Initialize double buffering on VGA

	pixel_ctrl_ptr = (int *)0xFF203020;
	*(pixel_ctrl_ptr + 1) = 0xC8000000; 	  			//backbuffer = on chip
  	pixel_buffer_start = *(pixel_ctrl_ptr+1); 			//pixel_buffer_start = on chip
    clear_screen();                           			//clear front buffer=onchip=backbuffer
    wait_for_vsync();                         			//front buffer swap back buffer
    *(pixel_ctrl_ptr + 1) = 0xC0000000;       			//back buffer = SDRAM
    pixel_buffer_start = *(pixel_ctrl_ptr+1); 			//pixel_buffer_start = back buffer
    clear_screen();                           			//clear front buffer


    //Initialize
    initializeObjects();

    // Render the level information
    render_level();
    game_state = VICTORY;

    int count = 0;
    while(1){

    	// Displayes the state onto the LEDs
		*(led_ptr) = ( ((game_state == PLAYING) << 9)  + player_mode );
		// Displayes the state onto the HEX Display
		if( game_state == PLAYING ){
			//Play
			int play = (0x73 << 24) | (0x38 << 16) | (0x77 << 8) | (0x6E);
			*(HEX3_HEX0_ptr) = play;
			*(HEX5_HEX4_ptr) = 0x00;
		}
		else if( game_state == PAUSED ){
			//Pause 
			int pause = (0x77 << 24) | (0x3E << 16) | (0x6D << 8) | (0x79);
			*(HEX3_HEX0_ptr) = pause;
			*(HEX5_HEX4_ptr) = 0x73;
		}
		else if(game_state == VICTORY){
			//Won
			int won = (0x3D << 24) | (0x5C << 16) | (0x5C << 8) | (0x5E);
			*(HEX3_HEX0_ptr) = won;
			*(HEX5_HEX4_ptr) = 0x00;
		}
		else if(game_state == DEAD){
			//Lost
			int pause = (0x38 << 24) | (0x5C << 16) | (0x6D << 8) | (0x78);
			*(HEX3_HEX0_ptr) = pause;
			*(HEX5_HEX4_ptr) = 0x00;
		}

		// If the game is not in PLAY mode
    	if( game_state != PLAYING ){
    		count++;
			if( (game_state == VICTORY || game_state == DEAD) && ((current_level != -1) && (current_level != 2) ) ){
				 //render_message();
    			if(count == 1){
				  render_message();
				  wait_for_vsync();
				}
    		}
			// If the game was paused then the controls will be rest from inerupts
    		if( game_state == PAUSED ){
    			continue;
    		}

    		// If restarted
    		if( restart == TRUE ){
    			count = 0;
    			if( (game_state == VICTORY || game_state == DEAD) && ((current_level != -1) && (current_level != 2) ) ){
					  wait_for_vsync();
					  clear_message();
    			}
				// If the game ended in VICTORY, then reset the victory flags
    				player_passed[FIREBOY_BOX] = FALSE;
    				player_passed[WATERGIRL_BOX] = FALSE;
				if( game_state == VICTORY ){
    				player_passed[FIREBOY_BOX] = FALSE;
    				player_passed[WATERGIRL_BOX] = FALSE;
    				current_level++;

    				if( current_level >= 3 ){
    					current_level = -1;
    				}

    				initializeObjects();
    				render_level();
    				
				}
				if(game_state == DEAD){
					if(current_level == 2)
						current_level = -1;
					initializeObjects();
    				render_level();
				}


    			// If the game was ended/lost then the players position will be reset
				redraw = TRUE;
				refresh = TRUE;
    			// Change the position to playing
    			game_state = PLAYING;
				if( current_level == -1 || current_level == 2 ){
					game_state = VICTORY;
					restart = FALSE;
					continue;
				}
    		}
    		else{
    			continue;
    		}
    		if( current_level == -1 || current_level == 2 ){
				game_state = VICTORY;
			}
    	}

		//up arrow
		if( KEYB_UP ){
			color_check = current_background[ y_box[player_mode] - MOVE_SPEED ][ x_box[player_mode] ];
			if( (color_check != WALL) && (color_check!= BARRIER) ) {
				redraw = 1;
				dy_box[player_mode] = -MOVE_SPEED;
			}
        	KEYB_UP = 0;
        	printf("UP");
		}

		//down arrow
		else if( KEYB_DOWN ){
			color_check = current_background[ y_box[player_mode] + MOVE_SPEED + 9][ x_box[player_mode] ];
			if( (color_check != WALL) && (color_check!= BARRIER) ) {
				redraw = 1;
				dy_box[player_mode] = MOVE_SPEED;
			}
        	KEYB_DOWN = 0;
		}

		//left arrow
		else if( KEYB_LEFT ){
			color_check = current_background[ y_box[player_mode] ][ x_box[player_mode] - MOVE_SPEED ];
			if( (color_check != WALL) && (color_check!= BARRIER) ) {
				redraw = 1;
				dx_box[player_mode] = -MOVE_SPEED;
			}
        	KEYB_LEFT = 0;
		}

		//right arrow
		else if( KEYB_RIGHT ){
			color_check = current_background[ y_box[player_mode] ][ x_box[player_mode] + MOVE_SPEED + 9];
			if( (color_check != WALL) && (color_check!= BARRIER) ) {
				redraw = 1;
				dx_box[player_mode] = MOVE_SPEED;
			}
        	KEYB_RIGHT = 0;
		}

		if(TIME_PASSED){
		 	redraw = 1;
		}

		if( redraw == 1){
			player_passed[player_mode] = TRUE;
			left_door_open = FALSE;
			right_door_open = FALSE;

			render_obstacles();
			check_button_press();

			//render_message();
			if( current_level == 1 ){
				render_magic_door();
			}

			render_player( player_mode );

			if( refresh == TRUE ){
				render_player( 1 - player_mode );
				//render_message();
				if(restart == FALSE){
					refresh = FALSE;
				}
			}
			//Switch buffer
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr+1);
			redraw = 0;

			if(restart == TRUE){
				restart = FALSE;
			}
		}
		if( (player_passed[FIREBOY_BOX] == TRUE) && (player_passed[WATERGIRL_BOX] == TRUE) ){
			//(*led_ptr) = 1;
			game_state = VICTORY;
		}
    }
}

// Initialize the coordinate value of all the objects off a level
void initializeObjects(){
	if( current_level == -1 || current_level == 2 )
		return;
	no_of_obsticles = -2;
	for( int iter=FIREBOY_BOX; iter <= OBSTACLE_BOX_4; iter++ ){
		if( inital_coordinates[current_level][ 2*iter ] == NO_OBJECT )
			continue;
		no_of_obsticles++;
		x_box[iter] = inital_coordinates[current_level][ 2*iter ];
		y_box[iter] = inital_coordinates[current_level][ 2*iter + 1];
	}
}

// Renders the starting point for a level: background and players
void render_level(){
    //Switch buffer
    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr+1);

    draw_background();
    if(current_level != -1 && current_level != 2){
	    render_player( FIREBOY_BOX );
	    render_player( WATERGIRL_BOX );
	}

	wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr+1);

    draw_background();
    if(current_level != -1 && current_level != 2){
	    render_player( FIREBOY_BOX );
	    render_player( WATERGIRL_BOX );
	}
}

// Updates and Renders the player onto the UI
void render_player(int player_type){
	//Erase
	clear_player(prev_x_box[player_type], prev_y_box[player_type]);
	//Save
	prev_x_box[player_type] = x_box[player_type];
	prev_y_box[player_type] = y_box[player_type];

	//Update
	x_box[player_type] += dx_box[player_type];  dx_box[player_type] = 0;
	y_box[player_type] += dy_box[player_type];  dy_box[player_type] = 0;

	if( restart == TRUE ){
		if(player_type == FIREBOY_BOX){
			x_box[player_type] = inital_coordinates[current_level][2*FIREBOY_BOX];	 y_box[player_type]= inital_coordinates[current_level][2*FIREBOY_BOX + 1];
		}
		else{
	    	x_box[player_type] = inital_coordinates[current_level][2*WATERGIRL_BOX]; y_box[player_type]= inital_coordinates[current_level][2*WATERGIRL_BOX + 1];
		}
	}
	//Draw
	draw_player(x_box[player_type], y_box[player_type], player_image[player_type]);
	
}

// Draws the Player onto the UI
void draw_player(int initial_x, int initial_y, int imgArr[100]) {
	int i = 0;
	for(int x=0; x<10; x++){
		for(int y=0; y<10; y++){
			if( imgArr[ x + 10*y ] == COLOR_TRANSPARENT )
				continue;

			color_check = current_background[ y + initial_y ][ x + initial_x ];
			if( (color_check == LAVA) || (color_check == MAGMA) || (color_check == LAKE) || (color_check == DEEP_LAKE) )
				game_state = DEAD;
			else if(  (color_check != FIRE_PORTAL) && (color_check != FIRE_DOOR) && (color_check != WATER_PORTAL) && (color_check != WATER_DOOR)  ){
				player_passed[player_mode] = FALSE;
			}

			plot_pixel(x + initial_x, y + initial_y, imgArr[ x + 10*y ]);
			i++;
		}
	}
}

// Clears a player from the UI
void clear_player(int initial_x, int initial_y){
	int i = 0;
	for(int x=0; x<10; x++){
		for(int y=0; y<10; y++){
			if( player_image[0][ x + 10*y ] == COLOR_TRANSPARENT )
				continue;
			plot_pixel(x + initial_x, y + initial_y, background_image[current_level+1][ y + initial_y ][x + initial_x]);
			i++;
		}
	}
}

// Updates and renders all of the obsticle with redraw. This is a wrapper function
void render_obstacles(){
	for( int obstacle_id = OBSTACLE_BOX_1; obstacle_id < no_of_obsticles+OBSTACLE_BOX_1; obstacle_id++ ){
		render_obstacle( inital_coordinates[current_level][2*obstacle_id], slider_range[current_level][obstacle_id-2], obstacle_id);
	}
}

// Updates and renders an obsticle with redraw
void render_obstacle(int initial_x, int final_x, int obstacle_type){

	if(x_box[obstacle_type] >= final_x && dx_box[obstacle_type] > 0) dx_box[obstacle_type] = -dx_box[obstacle_type];
	if(x_box[obstacle_type] <= initial_x && dx_box[obstacle_type] < 0) dx_box[obstacle_type] = -dx_box[obstacle_type];

	clear_obstacle(prev_x_box[obstacle_type], prev_y_box[obstacle_type]);

	prev_x_box[obstacle_type] = x_box[obstacle_type];
	prev_y_box[obstacle_type] = y_box[obstacle_type];

	if(TIME_PASSED){
		x_box[obstacle_type] += dx_box[obstacle_type];
		y_box[obstacle_type] += dy_box[obstacle_type];
		TIME_PASSED--;
	}

	draw_obstacle(x_box[obstacle_type], y_box[obstacle_type], obstacle_image[ (obstacle_type-2)%2 ]);
}

// Drawing one obsticle in redraw
void draw_obstacle(int initial_x, int initial_y, int imgArr[10][30]) {
	int i = 0;
	for(int x=0; x<30; x++){
		for(int y=0; y<10; y++){
			if( imgArr[y][x] == COLOR_TRANSPARENT )
				continue;
			current_background[ y + initial_y ][ x + initial_x ] = imgArr[y][x];

			plot_pixel(x + initial_x, y + initial_y, imgArr[y][x]);
			i++;
		}
	}
}

// Clearing the obstacle in redraw
void clear_obstacle(int initial_x, int initial_y){
	int i = 0;
	for(int x=0; x<30; x++){
		for(int y=0; y<10; y++){

			current_background[ y + initial_y ][ x + initial_x ] = background_image[current_level+1][ y + initial_y ][x + initial_x];

			plot_pixel(x + initial_x, y + initial_y, background_image[current_level+1][ y + initial_y ][x + initial_x]);
			i++;
		}
	}
}

// Render the magic door
void render_magic_door(){
	//128 to 159    121 124
	//162 to 194 121 124
	if(left_door_open == TRUE ){
		door_color1 = PATHWAY;
	}
	else{
		door_color1 = BARRIER;
	}

	if(right_door_open == TRUE ){
		door_color2 = PATHWAY;
	}
	else{
		door_color2 = BARRIER;
	}

	for(int x=127; x<159; x++){
		for(int y=119; y<125; y++){
			current_background[y][x] = door_color1;
			plot_pixel(x, y, current_background[y][x]); //paint peach
		}
	}

	for(int x=161; x<194; x++){
		for(int y=119; y<125; y++){
			current_background[y][x] = door_color2;
			plot_pixel(x, y, current_background[y][x]); //paint peach
		}
	}

}

// Render displayed image
void render_message(){
	//game_state
	if( game_state < DEAD || game_state > VICTORY)
		return;
	int initial_x = 19;
	int initial_y = 59;
	for(int x=0; x<280; x++){
		for(int y=0; y<120; y++){
			plot_pixel(x + initial_x, y + initial_y, message_image[game_state-2][y][x]);
		}
	}
}

// Clear displayed message
void clear_message(){
	//game_state
	int initial_x = 19;
	int initial_y = 59;
	for(int x=initial_x; x<initial_x+280; x++){
		for(int y=initial_y; y<initial_y+120; y++){
			plot_pixel(x, y, background_image[current_level+1][y][x]);
		}
	}
}

// Checks if the player is standing on a button to open up a magic door
void check_button_press(){
	int initial_x = x_box[FIREBOY_BOX]; int initial_y = y_box[FIREBOY_BOX];
	for(int x=0; x<10; x++){
		for(int y=0; y<10; y++){
			color_check = background_image[current_level+1][ y + initial_y ][ x + initial_x ];
			if( color_check == PURPLE_BUTTON ){
				right_door_open = TRUE;
			}
		}
	}
	initial_x = x_box[WATERGIRL_BOX]; initial_y = y_box[WATERGIRL_BOX];
	for(int x=0; x<10; x++){
		for(int y=0; y<10; y++){
			color_check = background_image[current_level+1][ y + initial_y ][ x + initial_x ];
			if( color_check == YELLOW_BUTTON ){
				left_door_open = TRUE;
			}
		}
	}
}

// Draws the background of the GAME
void draw_background() {
	int initial_x = 0; int initial_y = 0;
	for(int x=0; x<320; x++){
		for(int y=0; y<240; y++){
			current_background[y][x] = background_image[current_level+1][y][x];

			if( current_background[y][x] == door_color1 ){
				current_background[y][x] = BARRIER;
			}
			else if( current_background[y][x] == door_color2 ){
				current_background[y][x] = BARRIER;
			}

			plot_pixel(x + initial_x, y + initial_y, current_background[y][x]);
		}
	}
}


void wait_for_vsync(){
  volatile int *pixel_ctrl_ptr = (int*)0xFF203020;
  register int status;
  *pixel_ctrl_ptr = 1;
  status = *(pixel_ctrl_ptr + 3);
  while((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
}

void clear_screen(){
  for(int x=0; x<320; x++){
    for(int y=0; y<240; y++){
      plot_pixel(x,y,BLACK);
    }
  }
}

void plot_pixel(int x, int y, short int line_color)
{
	if(x > RESOLUTION_X || y > RESOLUTION_Y || x < 0 || y < 0) return;
	if(line_color == COLOR_TRANSPARENT) return;
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}
